import styled from "styled-components";

export const Panel = styled.div `
  border: 1px solid grey;
  border-radius: 0.25rem;
  margin: 0.5rem;
  padding: 0.5rem;
`;

export const RowPanel = styled.div `
  display: flex;
  flex-direction: row;
  gap: 0.5rem;
  margin: 0.5rem;
`;

export const RowPanelTitle = styled.div `
  flex-basis: 160px;
`;
